from math import isqrt
from sympy import primepi, primerange
def A033942(n):
    def f(x): return int(n+primepi(x)+sum(primepi(x//k)-a for a,k in enumerate(primerange(isqrt(x)+1))))
    kmin, kmax = 1,2
    while f(kmax) >= kmax:
        kmax <<= 1
    while True:
        kmid = kmax+kmin>>1
        if f(kmid) < kmid:
            kmax = kmid
        else:
            kmin = kmid
        if kmax-kmin <= 1:
            break
    return kmax # _Chai Wah Wu_, Aug 23 2024

